import React from 'react'

export default function Farmerpage() {
    return (
        <div class="card">
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shutterstock.com%2Fsearch%2Frandom&psig=AOvVaw1_ubGwPSSQKW9OjIu0OLwc&ust=1680628536341000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCPj0jKmbjv4CFQAAAAAdAAAAABAE" class="card-img-top" alt="..." />
            <div class="card-body">
                <h5 class="card-title">Card title</h5>
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href="#" class="btn btn-primary">Go somewhere</a>
            </div>
        </div>
    )
}
